import React, { Component } from 'react';
import styled from 'styled-components';
import QuestionCreater from './QuestionCreater/QuestionCreater';
import {connect} from 'react-redux';
import {addQuestion} from '../../store/actions/testCreater';


const Input = styled.input`
	margin: 5px;
	padding: 10px 5px;
	width: 80%;
	height: 10px;
	font-size: 12px;
`;
const FlexContainer = styled.div`
  display: flex;
  margin: auto;
  padding: 0 10px;
  margin-top: 5px;
  font-size: 14px;
  align-items: center;
  justify-content: space-between;
  width: ${props => props.width + '%' || '100%'};
  flex-direction: ${props => props.dir || 'row'};
  box-sizing: border-box;
`;
const Button = styled.button`
	margin: 5px;
	font-size: 18px;
  background: transparent;
  border-radius: 5px;
  border: 1px solid ${props => props.color  || ''};
  background-color: ${props => props.color || 'white'};
  width: ${props => props.width + 'em' || '2em'};
  height:${props => props.height + 'px' || '10px'};
`;
const TitleField = styled.textarea`
  rows: ${props => props.rows  || '4'};
  width: 100%;
`;

class TestCreater extends  Component {
	constructor(props) {
		super(props);
	}
	render() {
		return(
			<div>
			<form>
			<FlexContainer width={100} dir={'column'}>
				<FlexContainer width={70} dir={'column'}>
	          		<span>Input title of Test</span>
	          		<TitleField
	          			required
	          			rows={2} 
	          			value={''}
	          			id='title'
	          		/> 
	          	</FlexContainer>
	          	<FlexContainer width={70}>
	          		<FlexContainer dir='column' >
	          			Test type  
	          			<Input 
	          				required
	          				type='text' 
	          				placeholder='input type JS, PHP...'
	          		
	          		/>
	          	 	</FlexContainer>
	          		<FlexContainer dir='column' >
	          			Company name
	          			<Input 
	          				required
	          				type='text' 
	          				placeholder='Input company'
	          			/>
	          	 	</FlexContainer>
	          	 	<FlexContainer dir='column' >
	          			Test deadline
	          			<Input 
	          				required
	          				type='date' 
	          				placeholder='Input deadline of test'
	          			/>
	          	 	</FlexContainer>
	          	</FlexContainer>
	          	<QuestionCreater />
	          
			</FlexContainer>
			</form>
		</div>
		
	);

	}
}
function mapStateToProps(state) {
  return {
  	question: state.question,
  	answers: state.question.answers,
  	count: state.question.answers.length,
  	isRight: state.question.isRight,
  	score: state.question.score,
  	time: state.question.time,
  	questions: state.test.questions,
  }
}
function mapDispatchToProps(dispatch) {
  return {
    addAnswer: (answers) => dispatch(addAnswer(answers)),
    decreaseAnswersCount: () => dispatch(decreaseAnswersCount()),
    deleteChosenAnswer: (id) => dispatch(deleteChosenAnswer(id)),
    rightAnswerChosen: (isRight) => dispatch(rightAnswerChosen(isRight)),
    questionTitleHandler: (title) => dispatch(questionTitleHandler(title)),
   	timeHandler: (time) => dispatch(timeHandler(time)),
   	scoreHandler: (score) => dispatch(scoreHandler(score)),
   	addQuestion: (question) => dispatch(addQuestion(question)),
   	clearFields: () => dispatch(clearFields()),
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(TestCreater)
